    #[test]
    fn test_o9w7_byte_converter_factory() {

        struct TestContext {
            previous: Mutex<Option<u8>>,
            test_value_bytes: Vec<u8>,
        }

        impl Context for TestContext {

        }

        fn extract_byte_converter_from_context_u8<TByteConverter>(context: &mut TestContext) -> Result<TByteConverter, Box<dyn Error + Send + Sync + 'static>>
        where
            TByteConverter: ByteConverter,
        {
            let byte_converter = TByteConverter::deserialize_from_bytes(&context.test_value_bytes)?;
            Ok(byte_converter)
        }

        fn apply_u8<TByteConverter>(context: &mut TestContext, byte_converter: TByteConverter) -> Result<Option<u8>, Box<dyn std::error::Error + Send + Sync + 'static>>
        where
            TByteConverter: ByteConverter,
        {
            let output = *context.previous.lock().unwrap();
            let current = byte_converter.cast_via_bytes::<u8>()?;
            *context.previous.lock().unwrap() = Some(current);
            Ok(output)
        }

        let mut factory = DeserializationByteConverterFactory::default();
        factory.register::<u8, TestContext>(extract_byte_converter_from_context_u8, apply_u8);

        let test_value = 123u8;
        let type_name = std::any::type_name::<u8>();
        let mut extract_context = TestContext {
            previous: Mutex::new(None),
            test_value_bytes: test_value.to_vec_bytes().unwrap(),
        };

        // you start with a Box<dyn Any> because we don't know the T
        let output = factory.deserialize(&mut extract_context, type_name).unwrap();

        // downstream we can downcast when we know what T is
        assert_eq!(None, output);
    }

    #[test]
    fn test_p1w3_byte_converter_factory_with_trait_satisfied() {

        trait ConsumesValue {
            type TValue;

            fn consume_value(&mut self, value: impl GetValue<TValue = Self::TValue>);
        }

        impl ConsumesValue for Option<u8>
        {
            type TValue = u8;

            fn consume_value(&mut self, value: impl GetValue<TValue = Self::TValue>) {
                let next = value.get_value();
                *self = next;
            }
        }
        trait GetValue {
            type TValue;

            fn get_value(&self) -> Option<Self::TValue> where Self: Sized;
        }

        impl GetValue for u8
        {
            type TValue = u8;

            fn get_value(&self) -> Option<Self::TValue> {
                Some(*self)
            }
        }

        struct TestContext {
            previous: Option<u8>,
            test_value_bytes: Vec<u8>,
        }

        impl Context for TestContext {

        }

        fn extract_byte_converter_from_context_u8<TByteConverter>(context: &mut TestContext) -> Result<TByteConverter, Box<dyn Error + Send + Sync + 'static>>
        where
            TByteConverter: ByteConverter,
        {
            let byte_converter = TByteConverter::deserialize_from_bytes(&context.test_value_bytes)?;
            Ok(byte_converter)
        }

        fn apply_u8<TByteConverter>(context: &mut TestContext, byte_converter: TByteConverter) -> Result<Option<u8>, Box<dyn std::error::Error + Send + Sync + 'static>>
        where
            TByteConverter: ByteConverter + GetValue<TValue = u8>,
        {
            let output = context.previous.clone();
            context.previous.consume_value(byte_converter);
            Ok(output)
        }

        let mut factory = DeserializationByteConverterFactory::default();
        factory.register::<u8, TestContext>(extract_byte_converter_from_context_u8, apply_u8);

        let test_value = 123u8;
        let type_name = std::any::type_name::<u8>();
        let previous: Option<u8> = None;

        let mut context = TestContext {
            previous,
            test_value_bytes: test_value.to_vec_bytes().unwrap(),
        };

        // you start with a Box<dyn Any> because we don't know the T
        let output = factory.deserialize(&mut context, type_name).unwrap();

        // downstream we can downcast when we know what T is
        assert_eq!(None, output);
    }

